sys_variable_value.value:
(function execute(inputs, outputs) {
  var projectId = {};
  var shareIds = [];
  shareIds = inputs.shareds;
  if(shareIds != ""){
    outputs.shareds = JSON.stringify(shareIds);
  }
  else{
    outputs.shareds = "";
  }
  if(inputs.status){
    projectId['status'] = inputs.status;
  }
  if(inputs.customStatusId){
    projectId['customStatusId'] = inputs.customStatusId;
  }
  if(inputs.startDate){
    projectId['startDate'] = inputs.startDate;
  }
  if(inputs.endDate){
    projectId['endDate'] = inputs.endDate;
  }
  if(inputs.contractType){
    projectId['contractType'] = inputs.contractType;
  }
  if(inputs.ownerIds != ""){
    projectId['ownerIds'] = inputs.ownerIds;
  }
  outputs.project = JSON.stringify(projectId);
})(inputs, outputs);

