sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new WrikeUtils();
    utils.validateInputVariables(inputs, outputs);
    utils.validateMandatoryVariables(inputs, ['folderid','title']);
    utils.mapToOutputFromInput(inputs, outputs, ['title','folderid']);
})(inputs, outputs);

